import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';
import ShowForm from './components/ShowForm';
import ShowData from './components/ShowList';



function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Route path="/add">
        <ShowForm/>
      </Route>
      <Route path="/">
        <ShowData/>
      </Route>


      </BrowserRouter>
    </div>
  );
}

export default App;
